import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Header from './components/Header';
import Home from './components/Home';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <>

      <Header />
      <Routes>
        <Route path='/' element={<Home/>}></Route>
        <Route path='/signIn'/>
      </Routes>
    </>
  );
}

export default App;
